v1(data, context) { 
  const symbols = [];
  if(data.GoogleMaps.length) symbols.push('🌐');
  if(data.Images.length) symbols.push('🖼️');
  const addition = symbols.length ? ' (' + symbols.join(',') + ')' : '';
  return data.default + addition; 
}

